import React, { Component } from 'react';
import axios from 'axios';


export default class ListTous extends Component {

    constructor(props) {
        super(props);
        this.state = { profil: [] };

    }
    componentDidMount() {
        axios.get('http://localhost:8080/profil')
            .then(response => {
                console.log('i am a response', response)
                this.setState({ profil: response.data });
            })
            .catch(function (error) {
                console.log(error);
            })

        axios.get('http://localhost:8080/user/:'+obj.photo_profil)
            .then(response => {
                console.log('i am a response image', response)
                this.setState({ picture: response.data });
                console.log(picture);
            })
            .catch(function (error) {
                console.log(error);
            })

    }

    liste() {
        return <div>
            <div className="table-responsive">
                <table className="table">
                    <thead>
                        <tr>
                            <th>ID</th>
                            <th>NOM</th>
                            <th>EMAIL</th>
                            <th>PASSWORD</th>
                            <th>PHOTO</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            (this.state.profil.length > 0) ? (this.state.profil.map((obj) => {
                                return <tr >
                                    <td>{obj._id}</td>
                                    <td>{obj.nom}</td>
                                    <td>{obj.email}</td>
                                    <td>{obj.password}</td>
                                    <td> <img src={obj.photo_profil}/>
                                        </td>
                                </tr>

                            })) : ('')
                        }

                    </tbody>
                </table>
            </div>
        </div>
    }
    render() {
        return (
            <div>
                {this.liste()}
            </div>
        );
    }
}
